import { useState } from 'react';
import { Dialog, Popover } from '@headlessui/react';
import { Bars3Icon, XMarkIcon, ArrowNarrowLeftIcon } from '@heroicons/react/24/outline';
import { Link, useHistory } from 'react-router-dom';

export default function Nav() {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  const history = useHistory();
  const isHomePage = history.location.pathname === '/';

  const handleGoBack = () => {
    history.goBack();
  };

  return (
    <header className="bg-black">
      <nav className="container mx-auto flex justify-between items-center" aria-label="Global">
        <div className="flex lg:flex-1">
          {isHomePage ? (
            <Link to="/" className="-m-1.5 p-1.5">
              <span className="sr-only">Your Company</span>
              <div>
                <img src={`${process.env.PUBLIC_URL}/assets/logopng.png`} alt="Logo" className="w-[80px] h-[80px]" />
              </div>
            </Link>
          ) : (
            <button type="button" className="inline-flex items-center justify-center rounded-md p-2.5 text-pink-400" onClick={handleGoBack}>
              <ArrowNarrowLeftIcon className="h-6 w-6" aria-hidden="true" />
              <span className="sr-only">Voltar para a página inicial</span>
            </button>
          )}
        </div>
        {/* Restante do código */}
      </nav>
      {/* Restante do código */}
    </header>
  );
}
